import React from 'react'

function TodoList() {
  return (
    <div>
       <h1 style={{textAlign:'center'}}>Todo List</h1>
       <span>Sort:</span>
        <button className='btn btn-primary'>All</button>
    </div>
  )
}

export default TodoList
